'prototype',NULL,'id','aaa','<p>aa</p>','aaa','aaa','aaa',NULL,NULL,'2022-10-14 23:57:40','2022-10-14 23:57:40'),(458,303,10,6,NULL,'0','prototype',NULL,'id','Example Project','<p>This product is a user interface design product for example applications. The benefit is to make it easier for users to upload programs to the server.</p>',NULL,'https://google.com','https://google.com','2022-12-24 07:23:53',NULL,'2022-12-24 07:18:55','2023-01-13 13:52:09'),(459,892,3,6,NULL,'0','prototype',NULL,'en','Student Information System to manage student coaching data at SMKN 5 Malang','<p>This system is useful for managing student coaching data. System users are the student section, teachers, administration, parents and students. Through this system, the student division can record data on violations, witnesses, achievements and student awards, as well as record data. Parents of students can see the status of student coaching and receive summons to attend school if students have problems. This system was built using PHP, CSS and Mysql as the database management system</p>',NULL,NULL,'https://drive.google.com/file/d/1pCNzNtRNZ73BOdH2RZHe6Jop_p7mALRv/view?usp=share_link','2023-01-06 16:08:18',NULL,'2023-01-03 11:50:36','2023-01-20 08:23:40'),(460,892,3,6,NULL,'0','prototype',NULL,'id','Sistem Informasi Kesiswaan untuk mengelola data pembinaan siswa di SMKN 5 Malang','<p>Sistem ini berguna untuk mengelola data pembinaan siswa. Pengguna sistem adalah bagian kesiswaan, guru, tata usaha, orang tua dan siswa. Melalui sistem ini bagian kemahasiswaan dapat mendata pelanggaran, saksi, prestasi dan penghargaan mahasiswa, serta dapat melakukan perekapan data. Orang tua siswa dapat melihat status pembinaan siswa dan menerima surat panggilan jika siswa bermasalah. Sistem ini dibangun dengan menggunakan PHP, CSS dan Mysql sebagai sistem manajemen basis data</p>',NULL,NULL,'https://drive.google.com/file/d/1pCNzNtRNZ73BOdH2RZHe6Jop_p7mALRv/view?usp=share_link','2023-01-07 15:27:34',NULL,'2023-01-0