>\r\n</ul>',NULL,NULL,NULL,'2023-01-18 19:15:43',NULL,'2023-01-18 11:31:26','2023-01-18 19:15:43'),(965,918,4,6,NULL,'1','prototype',NULL,'en','Al-Quranisme','<p>The Al-Quranisme application is a software application used to read, search and listen to the Al-Quran (the holy book of Muslims). This application provides features such as translation, interpretation, maps of the nearest mosques, and murottal audio (recitation of the Koran by an expert reader).</p>\r\n<p>Al-Quranisme application has several benefits, including:</p>\r\n<p>Easily accessible<br />Translation and interpretation<br />Murottal audio<br />Search feature<br />Science</p>',NULL,NULL,NULL,'2023-01-18 11:39:21',NULL,'2023-01-18 11:34:34','2023-01-18 11:39:21'),(967,868,2,6,NULL,'1','prototype',NULL,'id','Inventaris-Aplikasi Peminjaman Barang Berbasis Desktop','<p>(Application Project 1) Aplikasi peminjaman barang adalah sebuah aplikasi yang memudahkan proses peminjaman barang. Aplikasi ini dapat digunakan oleh individu maupun organisasi yang membutuhkan barang sesuai dengan keperluan tertentu.</p>','https://github.com/varisDuke1/JAVA/tree/main/Ap%20Project%201','https://www.figma.com/file/oIHUB1PvxlIq01wTLfXpAN/Untitled?node-id=0%3A1&t=Vi3zCGoWEL3kk592-1',NULL,'2023-01-18 19:15:40',NULL,'2023-01-18 11:45:03','2023-01-18 19:15:40'),(968,863,2,6,NULL,'1','prototype',NULL,'en','PARKI','<p>PARKI is a simple parking management program that we created to make it easier collect data on problems that exist in the parking lot of STIKI Malang. The main feature of this program are check in, check out, edit user profiles, parking history, and also submit complaints.</p>',NULL,NULL,NULL,'2023-01-18 15:12:11',NULL,'2023-01-18 15:06:15','2023-01-18 15:12:11'),(969,930,10,6,NULL,'1','prototype',NULL,'en','Aqua Surveillance','<p>The main objective of our project is the development of a system that will make it easier to maintain water quality in RO and water coolers.</p>','https://github.com/beastbybirth/SIT-210_Project_aqua_surveillance.git','https://drive.google.com/file/d/1iURxPrvHdJupVxpYUjTD52rYWVOtKKtH/view?usp=drivesdk','https://youtu.be/-q-ZaSpJ0UU','2023-01-18 23:09:54',NULL,'2023-01-18 16:19:41','2023-01-18 23:09:54'),(970,896,1,6,NULL,'1','prototype',NULL,'en','Food Commodity Price Information','<p>This app is a place to provide the latest information about food commodity prices specifically for business actors in the agricultural sector and also business actors in the market.</p>',NULL,'qrco.de/prototypekomoditipangan',NULL,'2023-01-18 18:59:46',NULL,'2023-01-18 17:14:02','2023-01-23 20:26:01'),(971,915,1,6,NULL,'1','prototype',NULL,'en','Car Rental Application','<p>This application was created to make it easier for people to rent a car.</p>',NULL,NULL,NULL,'2023-01-18 19:15:30',NULL,'2023-01-18 19:13:29','2023-01-18 19:15:30'),(972,915,1,6,NULL,'1','prototype',NULL,'id','Aplikasi Rental Mobil','<p>Aplikasi ini dibuat untuk mempermudah masyarakat dalam melakukan rental mobil.</p>',NULL,NULL,NULL,'2023-01-18 19:15:37',NULL,'2023-01-18 19:15:00','2023-01-18 19:15:37'),(974,833,1,6,NULL,'1','prototype',NULL,'en','Carren ( Car Rental )','<p>Car rental is something that is used by many people, but for now there are still many who still use conventional modes, so they need more modern applications so that customers and car owners are safer because they are already integrated with the application.</p>',NULL,NULL,NULL,'2023-01-18 23:09:04',NULL,'2023-01-18 19:39:01','2023-01-18 23:09:04'),(975,833,1,6,NULL,'1','prototype',NULL,'id','Carren ( Car Rental)','<p>Rental Mobil merupakan hal yang digunakan untuk banyak orang namun untuk saat ini masih banyak yang masih menggunakan mode konvensional sehingga membutuhkan aplikasi yang lebih modern sehingga pelanggan dan pemilik mobil menjadi lebih aman karena sudah terintegrasi dengan aplikasi.</p>',NULL,NULL,NULL,'2023-01-18 23:10:25',NULL,'2023-01-18 19:41:26','2023-01-18 23:10:25'),(976,907,1,6,NULL,'1','prototype',NULL,'en','Colorly UI UX Design','<p>Discover, the world of color.<br />Build palettes, choose color, easiest as it ever been<br />through the language of Colorly.</p>',NULL,'https://bit.ly/3GNuQGs',NULL,'2023-01-18 23:08:41',NULL,'2023-01-18 21:36:22','2023-01-18 23:08:41'),(977,776,3,6,NULL,'1','prototype',NULL,'en','Employment Service Provider Information System For People With Disabilities “KERJAKARYA”','<p><span style=\"font-weight: 400;\">This information system serves to facilitate people with disabilities, especially the hearing impaired, speech impaired and physically disabled, in finding job information and submitting job applications and connecting them with job vacancy providers. The existence of data input features using voice or Speech To Text makes it easier for users with disabilities to enter data. Users of this system are people with disabilities, customer service and job providers.&nbsp; The system is built using PHP scripts and codeigniter as a framework.</span></p>',NULL,NULL,'https://drive.google.com/file/d/1LI4aZPS50vJ3stvKGnmYD2gZXEifVhNs/view?usp=sharing','2023-01-19 05:51:54',NULL,'2023-01-19 05:51:54','2023-01-20 08:21:26'),(978,776,3,6,NULL,'1','prototype',NULL,'id','Sistem Informasi Penyedia Jasa Ketenagakerjaan Khusus Penyandang Disabilitas “KERJAKARYA”','<p><span style=\"font-weight: 400;\">Sistem informasi ini berfungsi untuk mempermudah penyandang disabilitas khususnya tuna rungu, tuna wicara dan tuna daksa dalam mencari informasi pekerjaan dan melakukan pengajuan lamaran kerja&nbsp; serta menghubungkannya dengan penyedia lowongan pekerjaan. Adanya fitur input data menggunakan suara atau </span><em><span style=\"font-weight: 400;\">Speech To Text </span></em><span style=\"font-weight: 400;\">mempermudah user disabilitas tuna daksa dalam memasukkan data. Pengguna sistem ini adalah penyandang disabilitas, customer service dan penyedia lowongan kerja.&nbsp; Sistem dibangun dengan menggunakan script PHP dan codeigniter sebagai framework.</span></p>',NULL,NULL,NULL,'2023-01-19 05:53:36',NULL,'2023-01-19 05:53:36','2023-01-19 06:07:50'),(979,910,3,6,NULL,'1','prototype',NULL,'en','Student Information System to manage student coaching data at SMKN 5 Malang','<p><span style=\"font-weight: 400;\">This system is useful for managing student coaching data. System users are the student section, teachers, administration, parents and students. Through this system, the student division can record data on violations, witnesses, achievements and student awards, as well as record data. Parents of students can see the status of student coaching and receive summons to attend school if students have problems. This system was built using PHP, CSS and Mysql as the database management system.</span></p>',NULL,NULL,'https://drive.google.com/file/d/19-fdWfjkkIF0uYGH3R9zeJwIXAMF-Qdh/view?usp=sharing','2023-01-19 06:05:03',NULL,'2023-01-19 06:05:03','2023-01-20 08:22:04'),(980,910,3,6,NULL,'1','prototype',NULL,'id','Sistem Informasi Kesiswaan Guna Mempermudah Pembinaan Siswa SMKN 5 Malang','<p><span style=\"font-weight: 400;\">Sistem ini berguna untuk mengelola data pembinaan siswa. Pengguna sistem adalah bagian kesiswaan, guru, tata usaha, orang tua dan siswa. Melalui sistem ini bagian kemahasiswaan dapat mendata pelanggaran, saksi, prestasi dan penghargaan mahasiswa, serta dapat melakukan perekapan data. Orang tua siswa dapat melihat status pembinaan siswa dan menerima surat panggilan jika siswa bermasalah. Sistem ini dibangun dengan menggunakan PHP, CSS dan Mysql sebagai sistem manajemen basis data</span></p>',NULL,NULL,NULL,'2023-01-19 06:09:28',NULL,'2023-01-19 06:09:28','2023-01-19 06:09:28'),(981,832,1,6,NULL,'1','prototype',NULL,'id','Edustore','<p>Edustore merupakan aplikasi pembelajaran online di mana pengguna dapat menemukan dan membeli modul pembelajaran yang sesuai dengan kebutuhan pengguna.</p>',NULL,'https://www.figma.com/file/ody2JizwhYCEgXMXsq80sw/Kelompok-3---e-learning?node-id=183%3A2&t=ug30mxllDX1Y6WAx-1',NULL,'2023-01-19 10:28:07',NULL,'2023-01-19 09:50:41','2023-01-19 10:28:07'),(982,832,1,6,NULL,'1','prototype',NULL,'en','Edustore','<p>Edustore is online learning platform where users can find and buy learning modules that suits user needs.</p>',NULL,'https://www.figma.com/file/ody2JizwhYCEgXMXsq80sw/Kelompok-3---e-learning?node-id=183%3A2&t=ug30mxllDX1Y6WAx-1',NULL,'2023-01-19 10:27:59',NULL,'2023-01-19 10:04:27','2023-01-19 10:27:59'),(983,906,1,6,NULL,'1','prototype',NULL,'en','Bisa Beasiswa','<div class=\"w-full border-b border-black/10 dark:border-gray-900/50 text-gray-800 dark:text-gray-100 group bg-gray-50 dark:bg-[#444654]\">\r\n<div class=\"text-base gap-4 md:gap-6 m-auto md:max-w-2xl lg:max-w-2xl xl:max-w-3xl p-4 md:py-6 flex lg:px-0\">\r\n<div class=\"relative flex w-[calc(100%-50px)] md:flex-col lg:w-[calc(100%-115px)]\">\r\n<div class=\"flex flex-grow flex-col gap-3\">\r\n<div class=\"min-h-[20px] flex flex-col items-start gap-4 whitespace-pre-wrap\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>\"Bisa Beasiswa\" is a scholarship search application designed to make it easy for students to find scholarships that match their interests and abilities. Our UI/UX design is intended to provide an intuitive and user-friendly search experience. Features like custom search, filtering, and sorting will make it easier to find the right scholarship. We are confident that with Bisa Beasiswa, finding the right scholarship will be easier and more efficient.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','https://www.figma.com/file/NXXKEYvYlzqbqZt9bMp18B/Kelompok-3---Cek-Beasiswa?node-id=63%3A399&t=E6Z9BUjjbnRuZ0Si-1','http://bit.ly/3CxByz0',NULL,'2023-01-19 18:11:53',NULL,'2023-01-19 10:38:46','2023-01-19 19:10:05'),(984,916,1,6,NULL,'1','prototype',NULL,'en','MAKOS','<p>MAKOS is an application designed to help management in a boarding house. There is a room booking feature for visitors who rent a boarding house for the first time, extend the contract for old boarding house residents, a complaint feature, to a reminder for bills.</p>','https://www.figma.com/file/UpOVqQXTXYEFe77bq95iwc/Desain-Aplikasi-Manajemen-Kos?node-id=0%3A1&t=6hWT4TZE4QFXWLwZ-1',NULL,NULL,'2023-01-19 18:09:49',NULL,'2023-01-19 15:01:38','2023-01-19 18:09:49'),(985,916,1,6,NULL,'1','prototype',NULL,'id','MAKOS','<p>MAKOS adalah aplikasi yang dirancang untuk membantu manajemen pada sebuah kos-kosan. Terdapat fitur pemesanan kamar untuk pengunjung yang pertama kali menyewa kos, perpanjang kontrak untuk penghuni kos lama, fitur keluhan, hingga pengingat untuk tagihan.</p>','https://www.figma.com/file/UpOVqQXTXYEFe77bq95iwc/Desain-Aplikasi-Manajemen-Kos?node-id=0%3A1&t=6hWT4TZE4QFXWLwZ-1',NULL,NULL,'2023-01-19 18:10:49',NULL,'2023-01-19 15:09:47','2023-01-19 18:10:49'),(986,940,6,6,NULL,'1','prototype',NULL,'en','Smart Shopping Store Management','<div class=\"page\" title=\"Page 2\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p style=\"text-align: justify;\">These days, a vast variety of things can be purchased from numerous large retailers. We therefore need a huge workforce in order for the stores to operate well. The product that is still in the store can be quite challenging for personnel to keep track of. At these stores\' billing counters, there are periodically very long lines that take a very long time. Additionally, as technology advances, the security system must also be upgraded in order to prevent theft and other losses for the store.</p>\r\n<p style=\"text-align: justify;\">Due to the need to find a solution for this issue, we created an embedded system that can speed up the billing process as much as feasible. Complete shopping is now timeless thanks to the suggested method, which also increases the effectiveness of the security system. Even managing the quantity of each item in the store and keeping track of the details of customers that enter the store to shop are made simpler for the staff.</p>\r\n</div>\r\n</div>\r\n</div>','https://github.com/sohilnagpal04/SmartShoppingStore','https://www.youtube.com/watch?v=UktdZPtG08g','https://www.youtube.com/watch?v=xkPS5MP_HlY','2023-01-19 18:54:45',NULL,'2023-01-19 16:57:05','2023-01-19 18:54:47'),(990,893,5,6,NULL,'1','prototype',NULL,'en','Wa Yang: What Has Left Behind','<p>\"Wa Yang: What Has Left Behind\" is a unique and challenging 2D platformer game that blends traditional platformer elements with logic gate techniques, which requires players to think creatively and deeply to complete each level. Players will face various obstacles that must be overcome using various mechanisms available. Each level will present different challenges, making players constantly adapt and think quickly to advance to the next level.</p>',NULL,'https://drive.google.com/file/d/19ODg4LhWTjSQIGLBrg03islHwhCij2Ak/view?usp=share_link','https://drive.google.com/file/d/1wSy0ZipWrJ98ygxSF0GwwsO3H9Yhq0SU/view?usp=share_link','2023-01-20 08:03:37',NULL,'2023-01-19 19:36:40','2023-01-20 08:03:37'),(992,465,1,6,NULL,'1','prototype',NULL,'en','Eder: Innovation Library','<p>Eder is a mobile app that aims to boost enthusiasm for reading through the use of books, e-books, and gamification elements.</p>',NULL,'https://bit.ly/eder-prototype',NULL,NULL,NULL,'2023-01-20 00:49:47','2023-01-20 08:01:12'),(993,465,1,6,NULL,'1','prototype',NULL,'id','Eder: Innovation Library','<p>Eder adalah aplikasi mobile yang bertujuan untuk meningkatkan semangat membaca melalui penggunaan buku, e-book, dan elemen gamifikasi.</p>',NULL,'https://bit.ly/eder-prototype',NULL,'2023-01-20 08:02:11',NULL,'2023-01-20 00:54:20','2023-01-20 08:02:11'),(994,944,6,6,NULL,'1','prototype',NULL,'en','Smart Eatery and Evacuation System (SEES)','<p style=\"text-align: justify;\">Our project includes both the management of the emergency system and food ordering. The customer can use the payment wall to place meal orders and make payments. Regular customers will see their prior orders and be given suggestions based on their preferences. Orders can be accepted by the kitchen staff or chefs directly. Our design includes custom-designed door locks that are designed and developed by my team and have the capability to unlock doors using a manual keypad and a custom web interface. Additionally, a custom-designed system with integrated sensors that can sense LPG (liquid petroleum gas), CO (carbon monoxide), and smoke all at the same time will detect any type of perturbation in the gas level. Any aberrant readings will be indicated at the doors, and evacuation mechanisms will be activated. All of the doors will automatically open as part of the evacuation, and each door will generate an alarm to notify the people around. The system also has good fault tolerance and is easy to replace major components of the door and sensor systems, which increases its maintainability.</p>','https://github.com/xOscarCodes/EmbeddedSystemDevelopmentProject.git',NULL,'https://youtu.be/lkkF7n3mi6I','2023-01-20 08:01:16',NULL,'2023-01-20 01:21:27','2023-01-20 08:01:16'),(998,914,1,6,NULL,'1','prototype',NULL,'id','KucingKu','<p>Aplikasi HewanKu merupakan aplikasi pencari jodoh untuk hewan peliharaan. Pengguna dapat mencari pasangan hewan peliharaan yang mereka miliki terutama pemilik hewan ras yang sangat sulit untuk mencari pasangan hewan yang sejenis dengan hewan ras yang mereka miliki.</p>',NULL,'https://bit.ly/3WjzRMT',NULL,'2023-01-22 18:37:50',NULL,'2023-01-20 14:02:33','2023-01-22 18:37:50'),(999,914,1,6,NULL,'1','prototype',NULL,'en','HewanKu','<p>HewanKu application is a matchmaking application for pets. Users can search for a partner for the pet they have, especially the owner of a purebred animal, which is very difficult to find a partner for an animal that is the same as the purebred animal they have.</p>',NULL,'https://bit.ly/3WjzRMT',NULL,'2023-01-20 15:29:17',NULL,'2023-01-20 14:04:49','2023-01-20 15:29:17'),(1000,950,7,6,NULL,'1','prototype',NULL,'en','Social contribution poster introducing archipelago culture and toga plants at SDN Karangbesuki 04','<p>Culture is the identity of the nation, culture is what distinguishes us from other nations, therefore culture must be maintained and preserved. One of the well-known Indonesian cultures is gotong royong. We introduce the culture of gotong royong to the children of SDN Karangbesuki 4 by inviting them together.<br />by planting toga and also giving them education about the importance of the use of toga in everyday life.</p>',NULL,NULL,NULL,NULL,NULL,'2023-01-20 14:14:59','2023-01-20 15:32:04'),(1001,922,7,6,NULL,'1','prototype',NULL,'en','Contribution posters','<p>This contribution poster is a collection of various kinds of activities at the time of contribution starting from the abstract of the purpose and benefits of the activity. And there is also Documentation of activities.</p>',NULL,NULL,'https://drive.google.com/file/d/1NA9HnmR5z7Ga4OsRHk1WavXmD583RVoc/view?usp=drivesdk','2023-01-20 16:20:06',NULL,'2023-01-20 14:20:01','2023-01-20 16:20:06'),(1002,953,1,6,NULL,'1','prototype',NULL,'en','NEM Customer Care','<p>The following is a prototype design of the NEM Customer Care application which is a mobile-based technician service application, which will help you deal with internet problems 24 hours a day, and is accompanied by a marketplace feature that sells your various network needs.</p>','https://www.figma.com/file/G43PiP3CozV1sVcf2ajwPO/Design-UI_UX---181116046-Miftakhul-Islamy-Fatahillah?node-id=85%3A18&t=HtgXfhyIWcCr2XU1-1','https://bit.ly/miftakhul-portofolio',NULL,'2023-01-20 16:06:13',NULL,'2023-01-20 14:24:57','2023-01-20 16:06:13'),(1003,958,7,6,NULL,'1','prototype',NULL,'en','POSTER AR (AUGMENTED REALITY)','<p>Augmented Reality (AR) is an interactive technology capable of projecting virtual objects into real objects in real time. The development of AR technology today has made many contributions to various fields.</p>',NULL,NULL,'https://drive.google.com/drive/folders/12TqlODzC3jhl60jp1F6S3qze47V2Vk1R','2023-01-20 16:20:22',NULL,'2023-01-20 14:25:36','2023-01-25 08:18:00'),(1004,953,1,6,NULL,'1','prototype',NULL,'id','NEM Customer Care','<p>Berikut ini adalah desain prototype dari aplikasi NEM Customer Care yang merupakan aplikasi layanan teknisi berbasis mobile, yang akan membantu anda untuk menangani problem internet selama 24 Jam, dan disertai fitur marketplace yang menjual berbagai kebutuhan jaringan anda.</p>','https://www.figma.com/file/G43PiP3CozV1sVcf2ajwPO/Design-UI_UX---181116046-Miftakhul-Islamy-Fatahillah?node-id=0%3A1&t=HtgXfhyIWcCr2XU1-1','https://bit.ly/miftakhul-portofolio',NULL,'2023-01-22 18:38:01',NULL,'2023-01-20 14:26:40','2023-01-22 18:38:01'),(1005,958,7,6,NULL,'1','copyright','PMM 2 STIKI Malang','id','AUGMENTED REALITY (AR) Karya PMM 2 STIKI Malang','<p>Augmented Reality (AR) adalah teknologi interaktif yang mampu memproyeksikan objek maya ke dalam objek nyata secara real time. Perkembangan teknologi AR dewasa ini telah memberikan banyak kontribusi ke dalam berbagai bidang.Augmented Reality bertujuan menyederhanakan berbagai hal untuk pengguna dengan membawa informasi virtual ke dalam lingkungan pengguna. Tiga komponen dasar hardware yang harus dimiliki dalam pengembangan AR adalah sensor, processor dan display.&nbsp;Cara kerja augmented reality AR membutuhkan perangkat yang di lengkapi kamera seperti smartphone tablet atau kacamata pintar dan di dukung oleh perangkat AR saat pengguna mengarahkan perangkat ke obyek AR mengenalinya melalui teknologi visi computer sehingga pengguna melihat melalui obyek nyata dan digital</p>',NULL,NULL,'https://drive.google.com/drive/folders/12TqlODzC3jhl60jp1F6S3qze47V2Vk1R','2023-01-23 07:23:23',NULL,'2023-01-20 14:34:10','2023-01-23 07:23:23'),(1006,465,3,6,NULL,'1','prototype',NULL,'en','Mountcak','<p>Mountcak is a website that allows users to purchase tickets for mountain hiking. The site features a registration process and the option to pay for tickets using credit or debit card.&nbsp;</p>','https://github.com/rjial/muncak','https://mountcak.my.id/',NULL,'2023-01-20 16:08:03',NULL,'2023-01-20 14:57:35','2023-01-20 16:08:03'),(1007,465,3,6,NULL,'1','prototype',NULL,'id','Mountcak','<p>Mountcak adalah situs web yang memungkinkan pengguna membeli tiket untuk mendaki gunung. Situs ini menampilkan proses pendaftaran dan opsi untuk membayar tiket menggunakan kartu kredit atau debit.</p>','https://github.com/rjial/muncak','https://mountcak.my.id/',NULL,'2023-01-23 07:23:32',NULL,'2023-01-20 15:00:43','2023-01-23 07:23:32'),(1008,951,6,6,NULL,'1','prototype',NULL,'en','Mess Management System','<p>This system addresses a number of issues that might be seen in a hostel mess. The verification of kids accessing the mess is the first issue. It has been observed that many students who are not eligible for this facility use someone else\'s card for access since a security guard checks the cards &nbsp; handed to students. Students also have trouble in keeping track of their cards.&nbsp;</p>\r\n<p>Entry authentication is handled by facial recognition software. This system is placed at the mess gate, where a pi camera is set up to identify students and enable them admission by disabling the solenoid lock, which would otherwise keep the door locked.&nbsp;<br />The second mechanism, which is situated at the plate counter, is used to verify that the student who took a plate truly ate the food in the mess. Therefore, in order to pick up their plate, they must have their finger scanned on the plate counter.&nbsp;<br />The information about a student eating their food is updated according to the fingers scanned at the plate counter and communicated with the parents of the student via a website. Making this a parent-friendly approach.</p>','https://drive.google.com/file/d/1djZnUgCy7aChu2OmQk476iDWg3GERHj1/view?usp=share_link','https://www.youtube.com/watch?v=xzVMk9nVz9E','https://youtu.be/di_RZZOwKxc','2023-01-20 16:20:25',NULL,'2023-01-20 15:23:48','2023-01-20 16:20:25'),(1009,960,1,6,NULL,'1','prototype',NULL,'en','Game CX','<p>Game CX Top Up Game dan Joki Game dengan fitur mudah serta tampilan friendly khusus gamer</p>',NULL,NULL,NULL,'2023-01-20 16:20:28',NULL,'2023-01-20 15:24:09','2023-01-20 16:20:28'),(1010,922,3,6,NULL,'1','prototype',NULL,'id','Aplikasi Penghubung Mahasiswa dengan Dosen','<p>Aplikasi penghubung Mahasiswa dengan Dosen berisi informasi yang dibutuhkan mahasiswa dalam memudahkan menghubungi dosen pembimbing.</p>',NULL,NULL,NULL,'2023-01-23 07:23:52',NULL,'2023-01-20 15:26:00','2023-01-23 07:23:52'),(1011,922,3,6,NULL,'1','prototype',NULL,'en','Student and Lecturer Liaison Application','<p>The Student to Lecturer liaison application contains information needed by students to make it easier to contact the supervisor.</p>',NULL,NULL,NULL,'2023-01-20 16:08:56',NULL,'2023-01-20 15:29:50','2023-01-20 16:08:56'),(1012,799,1,6,NULL,'1','prototype',NULL,'en','Re-Design Paspor STIKI','<p>The primary purpose of this re-design UI of App Paspor STIKI is to make the app more easily used by college students, also the new UI was developed using guidelines from Google Material Design 3.</p>',NULL,'https://www.figma.com/proto/6yFnyYzPtKhlKVHJ78ljk0/Kelompok-2---Paspor-STIKI?node-id=181%3A1796&scaling=scale-down&page-id=181%3A1789&starting-point-node-id=181%3A1790',NULL,'2023-01-20 16:09:33',NULL,'2023-01-20 15:54:05','2023-01-20 16:09:33'),(1013,799,1,6,NULL,'1','prototype',NULL,'id','Desain Ulang Paspor STIKI','<p>Tujuan dari pembuatan ulang desain ui aplikasi ini adalah agar lebih memudahkan user dalam memakai aplikasi PASPOR, dengan menggunakan panduan dari Google Material Design 3.</p>',NULL,'https://www.figma.com/proto/6yFnyYzPtKhlKVHJ78ljk0/Kelompok-2---Paspor-STIKI?node-id=181%3A1796&scaling=scale-down&page-id=181%3A1789&starting-point-node-id=181%3A1790',NULL,'2023-01-23 07:24:05',NULL,'2023-01-20 15:55:36','2023-01-23 07:24:05'),(1014,963,1,6,NULL,'1','prototype',NULL,'en','SIAGA','<p>SIAGA - Disaster Early Warning Application</p>\r\n<p>SIAGA is an application design that is used to provide up-to-date information on disasters that have occurred and provides disaster details based on the scale and location of the disaster. In addition, SIAGA has a news feature about disasters that have occurred, donations to help victims affected by disasters and an emergency button when reporting a disaster and needing assistance.</p>',NULL,'https://bit.ly/prototypesiaga',NULL,'2023-01-20 16:20:36',NULL,'2023-01-20 16:02:59','2023-01-20 16:20:36'),(1015,963,1,6,NULL,'1','prototype',NULL,'id','SIAGA','<p>SIAGA - Early Warning Disaster Application</p>\r\n<p>SIAGA merupakan rancangan aplikasi yang digunakan memberikan informasi mengenai bencana yang terjadi secara up to date dan memberikan rincian bencana berdasarkan skala dan lokasi kejadian bencana. Disamping itu SIAGA memiliki fitur berita mengenai bencana yang telah terjadi, Donasi untuk membantu korban yang terdampak bencana serta emergency button apabila melaporkan terjadinya bencana dan membutuhkan bantuan.</p>',NULL,'https://bit.ly/prototypesiaga',NULL,'2023-01-23 07:24:19',NULL,'2023-01-20 16:06:13','2023-01-23 07:24:19'),(1016,961,1,6,NULL,'1','prototype',NULL,'en','Decoding the Periodic Table','<p>&nbsp;<strong>About Project</strong></p>\r\n<p><span class=\"S1PPyQ\">The Periodic Table is one of the topics that students often find tedious, uninteresting, and difficult to learn, despite the fact that they are required to do so. In order to address this issue and make these topics and concepts easier to learn, as well as to increase students\' interest in learning, it is important to find a solution.</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product Benefit</strong></p>\r\n<ul>\r\n<li><span class=\"S1PPyQ\">Interactive Study</span></li>\r\n<li><span class=\"S1PPyQ\">Economical</span></li>\r\n<li><span class=\"S1PPyQ\">Engaging Environment</span></li>\r\n<li><span class=\"S1PPyQ\">Significant and Positive Effect on the overall study of students.</span></li>\r\n<li><span class=\"S1PPyQ\">No Cramming.</span></li>\r\n<li><span class=\"S1PPyQ\">No change require in the way of learning</span></li>\r\n<li><span class=\"S1PPyQ\">Decrease the burden of Study.</span></li>\r\n</ul>','https://github.com/Varinder26Singh/Project','https://youtu.be/zPQ5DrmyVmU','https://youtu.be/2EU7ZIpU7SI','2023-01-20 16:20:39',NULL,'2023-01-20 16:08:04','2023-01-20 16:20:39'),(1017,927,3,6,NULL,'1','prototype',NULL,'en','SehatQu','<p>SehatQu is an application description to make it easier for users to control their health by accessing health facilities online. SehatQu also offers the concept of being healthy in the hands of any user\'s health needs which can be accessed through one application.</p>','https://drive.google.com/drive/folders/14s7ZgwR4N5mGq1LJ8t0hpxJhwyRkSLcE?usp=share_link','https://drive.google.com/file/d/1DJT58AxaYu-mxzpny993N79Rz_GQbL9k/view?usp=share_link','https://drive.google.com/file/d/1DJT58AxaYu-mxzpny993N79Rz_GQbL9k/view?usp=share_link','2023-01-21 07:53:50',NULL,'2023-01-20 16:11:52','2023-01-21 07:53:50'),(1018,947,9,6,NULL,'1','prototype',NULL,'en','Rakette','<p>\"Rakette\" is a racket service center located in Malang that provides 2 types of service, namely racket service and intact strings.<br />\"Rakette\" is suitable for those of you who play badminton and tennis</p>',NULL,NULL,NULL,'2023-01-21 07:54:09',NULL,'2023-01-20 19:16:23','2023-01-21 07:54:09'),(1019,947,9,6,NULL,'1','prototype',NULL,'id','Rakette','<p>\"Rakette\" adalah tempat servis raket yang berada di Malang yang menyediakan 2 jenis service yaitu servis raket senar sambungan dan utuh.<br />\"Rakette\" cocok untuk anda yang berolahraga badminton dan tenis</p>',NULL,NULL,NULL,'2023-01-23 07:24:38',NULL,'2023-01-20 19:17:54','2023-01-23 07:24:38'),(1020,836,3,6,NULL,'1','prototype',NULL,'id','TheCozy','<p>TheCozy merupakan sebuah webiste untuk membantu seseorang dalam mengatasi masalah mental&nbsp;<br />issue seperti keresahan, kecanduan, trust issue, dan sebagainya dengan memastikan dapat&nbsp;<br />dijangkau oleh segala lapisan masyarakat tanpa membebani harus bertemu secara langsung&nbsp;<br />ke tempat konselor juga menyediakan layanan yang profesional dengan harga terjangkau</p>',NULL,'http://www.thecozy.my.id/','https://drive.google.com/file/d/1nZDhqE4RUG1FTbM4iMYowxCzOvOWMVhK/view?usp=sharing','2023-01-23 07:24:49',NULL,'2023-01-20 19:34:34','2023-01-23 07:24:49'),(1021,346,5,6,NULL,'1','prototype',NULL,'en','The Smiley Game','<p>The game entitled \"The Smiley\" is a game of the \"Horror\" genre and this game is in the category \"Leisure Game\" for our platform we aim to make it for PCs using the unity3D engine. This game tells the story of someone who wants to save his life from being chased by monsters.<br />This character must survive by avoiding monsters that will chase him in the dark and this game has 3 Stages.</p>','https://www.mediafire.com/file/uynes6ao6lcc5ue/Script.rar/file','https://www.mediafire.com/file/ctaukc6ex11rvkt/The_Smiley.rar/file','https://www.youtube.com/watch?v=imNprHcW26I','2023-01-21 13:08:27',NULL,'2023-01-20 23:18:12','2023-01-26 20:11:11'),(1022,914,3,6,NULL,'1','prototype',NULL,'en','WeddingKu','<p>The WeddingKu application is a website-based online wedding invitation application. We made this website because of the high price of printed wedding invitations.</p>',NULL,'https://bit.ly/3QVxIpx','https://bit.ly/3GVjDnl','2023-01-21 07:54:39',NULL,'2023-01-20 23:30:43','2023-01-21 07:54:39'),(1023,346,4,6,NULL,'1','prototype',NULL,'en','Lokasiku','<p>Aplikasi ini adalah suatu tools untuk membantu anda untuk membagikan lokasi dimanapun anda berada dalam bentuk URL. Anda dapat membagikannya ke media sosial, dengan aplikasi yang sangat ringan ini akan membantu pengguna yang memiliki gadget yang tidak compatible pada google maps. Aplikasi ini dilengkapi oleh 3 Sensor yang dapat digunakan untuk mengelola aplikasi tersebut.</p>','https://www.mediafire.com/file/53s67328227sitq/Source_Code.rar/file','https://www.mediafire.com/file/72frb855fujfoyl/Lokasiku.apk/file','https://drive.google.com/file/d/1IZit6J-L5gTfdRadj6zbwRDTsI1KJRgA/view?usp=sharing','2023-01-21 13:02:35',NULL,'2023-01-20 23:31:07','2023-01-21 13:02:35'),(1024,972,8,6,NULL,'1','prototype',NULL,'en','Mountain reserve system','<p>We developed an IOT-based system with a real-time database and GUI for the general public to view the live water index level for any water body in order to keep an eye on this. Where the knowledge of people\'s water quality index and details on the location, formation, and bacteria composition,&nbsp; heavy minerals, germs, and other elements of the water body.</p>','https://github.com/kanishkjain0263/Ganga_Information_Reservation_System.git','https://youtu.be/Z2azp1fH8DY','https://youtu.be/Z2azp1fH8DY','2023-01-21 07:54:58',NULL,'2023-01-20 23:37:20','2023-01-21 07:54:58'),(1025,914,3,6,NULL,'1','prototype',NULL,'id','WeddingKu','<p>Aplikasi WeddingKu adalah aplikasi undangan pernikahan online berbasis website. Website ini kami buat karena mahalnya harga undangan pernikahan cetak.</p>',NULL,'https://bit.ly/3QVxIpx','https://bit.ly/3GVjDnl','2023-01-23 07:24:52',NULL,'2023-01-20 23:38:33','2023-01-23 07:24:52'),(1026,967,1,6,NULL,'1','prototype',NULL,'en','Animal Feeder','<p>This project\'s main functionality is to feed according to the type of pets using machine learning algorithm - OpenCV. The prototype includes a main body which further consists of 3 chambers, one for cat food (milk), other for dog food and the last for water. It contains the valves at the opening which would help the food to dispense. When the motors are turned on the valves get opened and the food is dispensed. The delay for which the motors will be working can be set accordingly.&nbsp;<br />There are three chambers for three different items and the LEDs glow when the motors glow. The water will be there in the container all the time and it uses the float switch mechanism and when the water reaches a threshold level then the circuit would open and the electricity would stop flowing and the motor would not work and hence the water would not dispense after a particular level.</p>','https://github.com/DishaMohindru1/animal_feeder.git','https://youtu.be/s0jinNXAjU8','https://youtu.be/s0jinNXAjU8','2023-01-21 07:55:36',NULL,'2023-01-21 00:34:55','2023-01-21 07:55:36'),(1027,965,6,6,NULL,'1','prototype',NULL,'en','ACM - Automatic Cocktail Maker','<p>This is an automatic cocktail maker, as the name suggests, where user have to input the desired drink, on the touch screena and see the drink being made in front of them. Different liquids are poured from different nozzles and glass travels to them automaticaly sitting on the belt. Ultrasonic sensors verify the presence of glass at desired location before pouring the liquid. Ratios and quantity are taken care of at the back end.&nbsp;</p>','https://github.com/vishaluniv/ACM-Project-Automated-Cocktail-Maker','https://youtu.be/DkmZ9DVs28g ; https://youtu.be/HVyRP0P5ZmA','https://youtu.be/7FP5DgoNN70 ; https://youtu.be/BZf7CYGTfoQ','2023-01-22 10:50:28',NULL,'2023-01-22 00:42:14','2023-01-22 10:50:28'),(1028,345,3,6,NULL,'1','prototype',NULL,'en','Dako Time Assistant - HRIS Systems','<p>Dako Time Assistant is a platform based on HRIS Systems to provide an easier presence experience.</p>',NULL,NULL,'https://drive.google.com/file/d/1EXfmT3xYzoMp_bFoZ_JpR0nXVpNAIzHb/view?usp=share_link',NULL,NULL,'2023-01-22 08:27:54','2023-01-22 10:50:22'),(1029,440,4,6,NULL,'1','copyright','@venturo.co.id','en','Sunsal Mobile','<p>The application is used for teacher and student attendance at Islamic boarding schools</p>',NULL,NULL,NULL,'2023-01-22 18:36:30',NULL,'2023-01-22 16:15:26','2023-01-22 18:36:30'),(1030,978,5,6,NULL,'1','prototype',NULL,'en','Dako Boardgame Online','<p>Dako Boardgame Online is an educational game created by Dako and developed into a digital game that aims to hone the ability to read digital marketing dashboards</p>',NULL,'https://liluo.io/yoga/dako-bordgame-indonesia','https://drive.google.com/file/d/114CjmruWOFtW0EERd5GMg0XIwUMuue3J/view?usp=drivesdk','2023-01-22 20:26:51',NULL,'2023-01-22 19:30:13','2023-01-22 20:26:51'),(1031,947,4,6,NULL,'1','prototype',NULL,'en','Mancal (Rental Sepeda)','<p>Mancal is an Android-based mobile application where users can rent bicycles according to the available venues around you.</p>','https://bit.ly/PrototypeMancal','https://bit.ly/PrototypeMancal','https://drive.google.com/file/d/1YGZjc8N0_OjxCV2Voc6eBxDtlm85nAdB/view?usp=drivesdk','2023-01-23 07:16:23',NULL,'2023-01-22 22:39:18','2023-01-23 09:59:42'),(1032,392,4,6,NULL,'1','prototype',NULL,'en','RemindMe','<p>The \"RemindMe\" app is an app used by students to help manage deadlines and remind them not to miss the deadline for submitting assignments that have been set.</p>',NULL,NULL,'https://youtu.be/JV0UJKTZ9aI','2023-01-23 20:29:15',NULL,'2023-01-23 12:04:46','2023-01-23 20:29:15'),(1033,392,4,6,NULL,NULL,'prototype',NULL,'id','RemindMe','<p>Aplikasi &ldquo;Remind Me&rdquo; adalah aplikasi yang digunakan mahasiswa untuk membantu mengatur deadline dan mengingatkan agar mahasiswa tidak melewatkan deadline pengumpulan tugas yang sudah ditentukan.</p>',NULL,NULL,'https://youtu.be/JV0UJKTZ9aI',NULL,NULL,'2023-01-23 12:05:20','2023-01-23 12:05:20'),(1034,836,1,6,NULL,NULL,'prototype',NULL,'id','Baber','<p>BABER adalah sebuah aplikasi untuk mengakses dan membaca berita dari berbagai sumber. Aplikasi ini menyediakan berita terbaru dari berbagai kategori seperti politik, olahraga, teknologi, dan lainnya. Beberapa aplikasi juga menyediakan fitur penyortiran atau filter berita sesuai dengan minat pembaca, sehingga pembaca dapat menemukan berita yang relevan dengan mudah. Aplikasi ini juga memiliki fitur bookmark untuk menyimpan berita yang inginkan untuk dibaca nanti, fitur sharing untuk membagikan berita yang Anda sukai kepada teman-teman Anda melalui media sosial atau e-mail, fitur video digunakan untuk menyampaikan sebuah berita dalam bentuk fakta yang faktual.</p>','https://www.figma.com/file/y2gouz53RkUKQ5h7V9eFeQ/Kelompok-5---Baber?node-id=133%3A540&t=F5Xi0m5NQbMoKHyD-1',NULL,NULL,NULL,NULL,'2023-01-23 13:55:49','2023-01-23 13:55:49'),(1035,862,3,6,NULL,'1','prototype',NULL,'en','SELMA','<p>Aplikasi online berbasis website untuk menampilkan informasi pendaftaran mahasiswa baru di AMD Academy</p>','http://projectakhirdp1.lovestoblog.com','https://drive.google.com/file/d/1KSopC9pCgpTbrY4VcLOBGvjWQ7nZv7_K/view?usp=drivesdk','https://drive.google.com/file/d/1KSopC9pCgpTbrY4VcLOBGvjWQ7nZv7_K/view?usp=drivesdk','2023-01-23 20:29:18',NULL,'2023-01-23 13:58:09','2023-01-23 20:29:18'),(1036,984,3,6,NULL,'1','prototype',NULL,'en','CAR - Iclean','<p>Sebuah program sales activity tracking untuk X2O (anak perusahaan iClean) yang bergerak pada bidang housekeeping.</p>',NULL,'https://car.yntkts.my.id/',NULL,'2023-01-23 20:29:21',NULL,'2023-01-23 14:38:28','2023-01-23 20:29:21'),(1037,983,4,6,NULL,'1','prototype','@digiponic.co.id','en','SIMONSA','<p>The application is used for sales monitoring and attendance.</p>','https://github.com/inbis-stiki/hris-apps.git',NULL,NULL,'2023-01-23 20:29:25',NULL,'2023-01-23 14:41:02','2023-01-23 20:29:25'),(1039,887,3,6,NULL,'1','prototype',NULL,'en','Learning Management System & Automation WA','<p>Learning Management System (LMS) / commonly known as e-course / online course, is a software application designed to create, distribute, and manage to include learning material in a network. LMS aims to facilitate educators in planning the online learning process.</p>',NULL,NULL,NULL,'2023-01-23 20:29:29',NULL,'2023-01-23 16:46:42','2023-01-23 20:29:29'),(1040,887,3,6,NULL,NULL,'prototype',NULL,'id','Learning Management System & Automation WA','<p>Learning Management System (LMS) / biasa dikenal dengan e-course / kursus online adalah <span class=\"notion-enable-hover\" data-token-index=\"0\">A</span><span class=\"notion-enable-hover\" data-token-index=\"1\">plikasi perangkat lunak yang dirancang untuk membuat, mendistribusikan, dan mengatur penyampaian materi pembelajaran dalam jaringan</span>. LMS bertujuan untuk memudahkan tenaga pendidik dalam merencanakan proses belajar online.</p>',NULL,NULL,NULL,NULL,NULL,'2023-01-23 16:50:49','2023-01-23 16:50:49'),(1041,367,3,6,NULL,'1','prototype',NULL,'en','WEB-BASED EVENT ORGANIZER SERVICE INFORMATION SYSTEM','<p><span style=\"font-weight: 400;\">This application is useful for assisting vendors in marketing event organizer services in the form of service product packages and managing monthly reports, assisting potential customers in finding and obtaining the right vendor service information according to their wishes and needs. make online ordering transactions, confirm payment by uploading proof of payment, cancel orders, apply for refunds/refunds. Users of this system are Admin, vendors, customers and visitors. The system was built using PHP with the CodeIgnater framework and mysql as the DBMS.</span></p>',NULL,NULL,'https://drive.google.com/file/d/1PW27x8pTbwzqeoH-OqhZJ_Gnc7bUQoCN/view?usp=sharing','2023-01-23 20:29:32',NULL,'2023-01-23 16:53:42','2023-01-23 20:29:32'),(1042,367,3,6,NULL,'1','prototype',NULL,'id','SISTEM INFORMASI LAYANAN JASA EVENT ORGANIZER BERBASIS WEB','<p><span style=\"font-weight: 400;\">Sistem</span><em><span style=\"font-weight: 400;\"> ini </span></em><span style=\"font-weight: 400;\">berfungsi membantu para vendor dalam memasarkan layanan jasa event organizer dalam bentuk paket produk layanan dan mengelola laporan bulanan,&nbsp; membantu calon pelanggan dalam mencari dan mendapatkan informasi layanan vendor yang tepat sesuai dengan keinginan dan kebutuhan. melakukan transaksi pemesanan online, konfirmasi pembayaran dengan mengupload bukti pembayaran, membatalkan pesanan, mengajukan pengembalian dana/refund. Pengguna sistem ini adalah Admin, vendor, pelanggan dan pengunjung. Sistem dibangun dengan menggunakan PHP dengan framework CodeIgnater dan mysql sebagai DBMS.</span></p>',NULL,NULL,'https://drive.google.com/file/d/1PW27x8pTbwzqeoH-OqhZJ_Gnc7bUQoCN/view?usp=sharing','2023-01-23 16:58:11',NULL,'2023-01-23 16:58:11','2023-01-23 16:58:11'),(1043,424,3,6,NULL,'1','prototype',NULL,'en','Body Truck Body Administration Information System at CV. Ganda Putra Sukses','<p>This information system is useful for managing the process of customer registration, product ordering, order validation and delivery of order progress. Through this system, customers can also view the product catalog and see the progress of the ordered<br />product. Users of this system are administration, leaders and customers. The system was built using PHP with the codeignater framework and mysql as the DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1mZuU2qPXrcNSUpAcuu5xtu-IKNeliKs1/view?usp=sharing','2023-01-23 20:29:36',NULL,'2023-01-23 17:17:16','2023-01-23 20:29:36'),(1044,424,3,6,NULL,'1','prototype',NULL,'id','Sistem informasi Administrasi Karoseri Bak Truck Pada  CV. Ganda Putra Sukses','<p>Sistem informasi ini berguna untuk mengelola proses pendaftaran pelanggan, pemesanan produk, validasi pesanan dan penyampaian progres pemesanan. Melalui ssistem ini pelanggan juga dapat melihat katalog produk dan melihat progres pengerjaan produk yang dipesan. Pengguna sistem ini adalah administrasi, pimpinan dan pelanggan. Sistem dibangun dengan mengguakan PHP dengan framework codeignater dan mysql sebagai DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1mZuU2qPXrcNSUpAcuu5xtu-IKNeliKs1/view?usp=sharing','2023-01-23 17:20:56',NULL,'2023-01-23 17:20:56','2023-01-23 17:20:56'),(1045,825,3,6,NULL,'1','prototype',NULL,'en','Adiosgen','<p class=\"ok_Wdg UPenfA RVfbug\"><strong>Adios Gen</strong> is here to ease the work of medical personnel in diagnosing tuberculosis and pneumonia. The process of diagnosing diseases can take time and this process is prone to errors if done continuously by humans.<br />The need for automation processes carried out by machines is very helpful in the diagnostic process. The problem to be faced is inconsistency in the manual diagnostic process.</p>','https://github.com/yourbeagle/adiosgen','https://adiosgen.vercel.app/',NULL,'2023-01-23 20:29:07',NULL,'2023-01-23 18:56:27','2023-01-23 21:27:45'),(1046,985,3,6,NULL,'1','copyright','Jagoanhosting','en','Quick Payment Page','<p>The Quick Payment page is an alternative page to the default payment page, after the customer has checked out of purchasing a product or service at Jagoan Hosting Indonesia.</p>',NULL,'https://drive.google.com/file/d/1wuN0kxqqMNTfMKrXw0SVP319cXGQZ0vo/view?usp=sharing','https://drive.google.com/file/d/1wuN0kxqqMNTfMKrXw0SVP319cXGQZ0vo/view?usp=sharing',NULL,NULL,'2023-01-23 19:07:34','2023-01-23 20:23:47'),(1047,346,1,6,NULL,'1','prototype',NULL,'en','My Cattle Desain Prototype UI-UX','<p>We present a time reminder application for farmers, namely MyCattle. This application contains data input from animals that have just been harvested, then this application will automatically determine when the next harvest date will be. Not only harvesting, but this application has a custom mark of calendar feature.<br />Which serves to remind the breeders selling time with the right time. By the way, the alarm will sound every time you specify.</p>','https://www.figma.com/file/jJ6OpXq2pbuOuiUvl8kTPC/Untitled?node-id=0%3A1','https://www.figma.com/file/jJ6OpXq2pbuOuiUvl8kTPC/Untitled?node-id=0%3A1',NULL,'2023-01-23 21:26:30',NULL,'2023-01-23 20:31:48','2023-01-23 21:26:33'),(1048,346,1,6,NULL,'1','prototype',NULL,'id','My Cattle - Desain Prototype UI-UX','<p><span style=\"font-weight: 400;\">Kami menghadirkan aplikasi pengingat waktu untuk para peternak yaitu MyCattle. Aplikasi ini berisi tentang penginputan suatu data dari hewan yang baru dipanen, lalu aplikasi ini akan otomatis menentukan kapan tanggal panen selanjutnya. Bukan hanya panen tetapi aplikasi ini mempunya fitur custom mark of calendar. Yang berfungsi untuk mengingatkan para peternak waktu jual dengan waktu yang tepat. Dengan cara alarm akan berbunyi setiap waktu yang di tentukan.&nbsp;</span></p>','https://www.figma.com/file/jJ6OpXq2pbuOuiUvl8kTPC/Untitled?node-id=0%3A1','https://www.figma.com/file/jJ6OpXq2pbuOuiUvl8kTPC/Untitled?node-id=0%3A1',NULL,'2023-01-23 21:12:26',NULL,'2023-01-23 20:33:54','2023-01-23 21:12:26'),(1049,897,1,6,NULL,'1','prototype',NULL,'id','Informasi Harga Komoditas Pangan','<p>Aplikasi ini menyajikan Informasi Harga komoditas pangan teraktual yang ditujukan untuk para petani dan pelaku bisnis khususnya bisnis yang bergerak di bidang aglikultur dan pertanian.</p>',NULL,'https://www.figma.com/proto/gAxLJJcXy5IMQ4VstzInf9/Prototype-APP-STIKI-TECHNOFEST-5.0?node-id=132%3A2788&scaling=min-zoom&page-id=105%3A1183&starting-point-node-id=132%3A2788',NULL,'2023-01-23 21:11:58',NULL,'2023-01-23 20:35:44','2023-01-23 21:11:58'),(1050,796,4,6,NULL,'1','prototype',NULL,'en','PetCare','<p>The Pet Care application is an Android-based application that is intended to provide convenience for pet owners through various features provided by the application, as follows:</p>\r\n<ul>\r\n<li>Pet consulting chatbots;</li>\r\n<li>Create and view pet-related posts;</li>\r\n<li>Organize pet activity schedules;</li>\r\n<li>Read news about pets;</li>\r\n<li>View the nearest Pet Shop point from the user\'s location.</li>\r\n</ul>','https://github.com/Kakaranara/petCare-CapstoneProject',NULL,NULL,'2023-01-24 13:29:52',NULL,'2023-01-23 21:06:37','2023-01-24 13:29:56'),(1051,669,8,6,NULL,'1','prototype',NULL,'en','Home Credit Risk Scoring','<p>Credit scoring is an assessment to determine whether a loan applicant is eligible for a loan based on criteria set by the lending organization or institution. In general,<br />Credit scoring is a method used by banks in determining whether or not a loan applicant is eligible to get a loan. Based on the above, a data science solution is created to predict the loan repayment ability of loan applicants.<br />A recommendation system is needed for lending organizations that can predict whether or not to provide loans to people who have no previous credit history or to people who have a previous credit history. This project was carried out with several students from other universities at PT. Zona Edukasi Nusantara ( Zenius ).</p>','bit.ly/DashboardHomeCreditRiskScoring',NULL,NULL,'2023-01-24 13:29:43',NULL,'2023-01-23 22:02:55','2023-01-24 13:29:48'),(1052,409,3,6,NULL,'1','prototype',NULL,'en','Dako Brand & Communication offers','<p>on this page is an offer, one of which is owned by Dako, namely training and technical guidance to provide a fun and enjoyable digital marketing and communication training experience.</p>',NULL,'https://dakobc.com/pelatihandanbimbinganteknis/',NULL,'2023-01-24 08:27:24',NULL,'2023-01-23 23:59:41','2023-01-24 13:29:39'),(1053,362,3,6,NULL,'1','prototype',NULL,'en','CASHIER MANAGEMENT INFORMATION SYSTEM AT CAFE VICTORIUS WEB-BASED FOR EASY SALES REPORTING.','<p>This information system is useful for making order transactions, managing daily stock, selling and reporting cashier&amp;#39;s income<br />each shift, managing compensation, and monthly reporting. Users of this system are owners, admins, cashiers. This system<br />was built using PHP with the Codeigniter framework and MySql as the DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1tVgfPX2JDzqlW7L4QO1gvIHdeoH7JYj6/view?usp=sharing','2023-01-24 02:32:00',NULL,'2023-01-24 02:32:00','2023-01-24 13:29:29'),(1054,987,3,6,NULL,'1','prototype',NULL,'en','HRIS - Human Resource Information System','<p>HRIS merupakan&nbsp;solusi dari permasalahan manajemen SDM di perusahaan. Contoh dari penerapan software HRIS perusahaan adalah sistem rekrutmen, data absensi, penggajian, dan pelatihan karyawan yang disimpan pada satu database</p>','https://github.com/inbis-stiki/hris-web','https://hris.yntkts.my.id/',NULL,'2023-01-24 02:35:42',NULL,'2023-01-24 02:34:26','2023-01-24 13:29:20'),(1055,362,3,6,NULL,'1','prototype',NULL,'id','SISTEM INFORMASI PENGELOLAAN KASIR PADA  CAFE VICTORIUS BERBASIS WEB GUNA MEMPERMUDAH PELAPORAN PENJ','<p>Sistem informasi ini berguna untuk melakukan transaksi pemesanan, pengelolaan stok harian, penjualan dan pelaporan<br />pendapatan kasir tiap shift, pengelolaan ganti rugi dan pelaporan bulanan. Pengguna sistem ini adalah pemilik, admin,<br />kasir. Sistem ini dibangun menggunakan PHP dengan framework Codeigneter dn My Sql sebagai DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1tVgfPX2JDzqlW7L4QO1gvIHdeoH7JYj6/view?usp=sharing','2023-01-24 02:34:42',NULL,'2023-01-24 02:34:42','2023-01-24 02:34:42'),(1056,361,3,6,NULL,'1','prototype',NULL,'en','Information System for Managing Job Training for Vocational Students on CV. Libra Tech to Facilitate','<p>This information system is used to manage job training for vocational students. Its features are registration of participants,<br />determining tutors, attendance, assigning assignments, collecting assignments, and reporting. Users of this system are administrators, teachers, and students. The system was built using PHP scripts with the CodeIgniter framework and My sql as the DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1Smvxd8F0sR8ZhKSZiMx8tRMEFRMArb1g/view?usp=sharing','2023-01-24 02:46:02',NULL,'2023-01-24 02:46:02','2023-01-24 02:46:02'),(1057,361,3,6,NULL,'1','prototype',NULL,'id','Sistem Informasi Pengelolaan Pelatihan Kerja Bagi Siswa Kejuruan Pada CV. Libra Tech Guna Memudahkan','<p>Sistem informasi ini digunakan untuk melakukan pengelolaan pelatihan kerja bagi siswa kejuruan.Fitur yang dimiliki adalah<br />pendaftaran peserta, penentuan tutor, presensi kehadiraan, pemberian tugas, pengumpulan tugas dan pelaporan. Pengguna sistem ini adalah pengelola, pengajar dan siswa. Sistem dibangun dengan menggunakan script PHP dengan framework CodeIgneter dan Mysql sebagai DBMS.</p>',NULL,NULL,'https://drive.google.com/file/d/1Smvxd8F0sR8ZhKSZiMx8tRMEFRMArb1g/view?usp=sharing','2023-01-24 02:48:24',NULL,'2023-01-24 02:48:24','2023-01-24 02:48:24'),(1058,802,3,6,NULL,'1','prototype',NULL,'en','A WEB-BASED SALES ORDER INFORMATION SYSTEM AT ORIJAWA','<p>Orijawa is a company that sells accessories and household appliances online with COD payments. In the process of receiving<br />orders, customers will contact CS using WhatsApp. This process is considered time-consuming because CS needs to calculate the<br />package value and get customer approval. Financial recording by the Administration is still using Ms. Excel so there may be errors in<br />recording unbalanced accounts. So we need a web-based application that can replace WhatsApp in receiving orders to manage financial data. This application is designed using the PHP programming language with the CodeIgniter framework and data storage using MySQL. Testing on the application is carried out using the black box testing method.</p>',NULL,NULL,'https://drive.google.com/file/d/12fiUY7JCW1UD4paAM5W9JGtjYKKn2KN_/view?usp=sharing','2023-01-24 02:54:39',NULL,'2023-01-24 02:54:39','2023-01-24 13:29:14'),(1059,802,3,6,NULL,'1','prototype',NULL,'id','SISTEM INFORMASI PEMESANAN PADA ORIJAWA BERBASIS WEB','<p>Orijawa merupakan perusahaan yang melakukan penjualan aksesoris dan peralatan rumah tangga secara online dengan<br />pembayaran COD. Dalam proses menerima order, Customer akan menghubungi CS menggunakan media whatsapp. Proses ini<br />dianggap cukup memakan waktu karena CS perlu melakukan perhitungan nilai paket dan mendapatkan persetujuan customer.<br />Pencatatan keuangan oleh Administrasi masih dilakukan menggunakan Ms.Excel sehingga kemungkinan terjadi kesalahan pencatatan akun yang tidak seimbang. Sehingga dibutuhkan sebuah aplikasi berbasis web yang dapat menggantikan whatsapp dalam menerima order mengelola data keuangan. Aplikasi ini dirancang menggunakan bahasa pemrograman PHP dengan framework CodeIgniter dan penyimpanan data menggunakan database MySQL. Pengujian aplikasi dilakukan menggunakan metode blackbox testing.</p>',NULL,NULL,'https://drive.google.com/file/d/12fiUY7JCW1UD4paAM5W9JGtjYKKn2KN_/view?usp=sharing','2023-01-24 02:57:51',NULL,'2023-01-24 02:57:51','2023-01-24 02:57:51'),(1060,477,3,6,NULL,'1','prototype',NULL,'en','Developing A Counseling Services & Administration Management System (A Case Study At Lentera Psycholgy Practice)','<p><span style=\"font-weight: 400;\">The Lentera Psychology Practice is one of the business entities in the service sector, more precisely in the field of psychological services. Where to be able to schedule services, both individually and on behalf of the institution, prospective patients can only do so through the whatsapp application, and the Lentera Psychology Practice must serve them one by one. Of course, this is very complicated and convoluted, the time required is also not small, especially when there are many patients, the Lentera Psychology Practice will find it difficult to handle it. In addition, so far the Lentera Psychology Practice has not been able to monitor the patient\'s condition. In this study, the author will create a web-based application that can help, speed up, and facilitate the parties involved in the registration process, scheduling, and monitoring the patient\'s condition through the mood diary feature. This web application is built using the PHP programming language, as well as the PHP framework, namely Laravel. And use MySQL as database management system</span></p>',NULL,NULL,'https://drive.google.com/file/d/19cr8ayuc9lem5_UD7oreXrzWunGBtfpf/view?usp=sharing','2023-01-24 03:07:18',NULL,'2023-01-24 03:07:18','2023-01-24 13:29:08'),(1061,477,3,6,NULL,'1','prototype',NULL,'id','Rancang Bangun Aplikasi Pengelolaan Administrasi Dan Layanan Konseling Berbasis Website (Studi Kasus : Biro Psikologi Lentera))','<p><span style=\"font-weight: 400;\">Biro Psikologi Lentera merupakan salah satu badan usaha di bidang jasa, lebih tepatnya pada bidang jasa layanan psikologis. Dimana untuk dapat melakukan penjadwalan layanan, baik secara individu maupun mewakili lembaga, calon pasien hanya bisa melakukannya melalui aplikasi whatsapp, dan pihak Biro Psikologi Lentera harus melayani calon pasien tersebut secara satu persatu. Tentunya hal tersebut sangat rumit dan berbelit, waktu yang dibutuhkan juga tidak sedikit, apalagi saat pasien sedang banyak, pihak Biro Psikologi Lentera akan kesulitan untuk mengatasinya. Selain itu, selama ini Biro Psikologi Lentera juga belum bisa untuk melakukan pemantauan kondisi terhadap pasien. Dalam penelitian ini, penulis akan membuat aplikasi berbasis web yang dapat membantu, mempercepat, serta mempermudah pihak-pihak terkait dalam melakukan proses pendaftaran, penjadwalan, sampai pemantauan kondisi pasien melalui fitur mood diary. Aplikasi web ini dibangun dengan menggunakan bahasa pemrograman PHP, serta framework PHP, yakni Laravel. Dan menggunakan MySQL sebagai sistem manajemen basis data.</span></p>',NULL,NULL,'https://drive.google.com/file/d/19cr8ayuc9lem5_UD7oreXrzWunGBtfpf/view?usp=sharing','2023-01-24 03:09:08',NULL,'2023-01-24 03:09:08','2023-01-24 03:09:48'),(1062,990,8,6,NULL,'1','prototype',NULL,'en','BUSINESS PROCESS ANALYSIS AND IMPLEMENTATION OF OPEN SOURCE ERP SYSTEM ODOO  INVENTORY, SALES AND PU','<p><span style=\"font-weight: 400;\">Information technology is the most important thing for business development in company. Resources in company,&nbsp; must be used and managed optimally, one of them is inventory, purchase, and sales part. ERP (Enterprise Resource Planning ) System is intergrated information system concept and can be used for company nor SME (Small micro medium enterprises) to developing their performance. Captain Gadget is one of&nbsp; medium-sized enterprises in Malang city which engaged to sales handphone, accessories, sparepart in retail industry. Captain gadget has three employes to operate in their company. In purchase management operate by Admin, in inventory management operate by warehouse admin, also in sales and marketing part operate by seller. Captain gadget in processing data used microsoft excel, while invoice and book keeping proccesed by manually. This causes not effective and efficient for company performance. So captain gadget need ERP system implementation and configuration to support their process business activity.one of them is wearing Odoo ERP Software based on opensource that can customized with system requirements in Captain Gadget business process</span></p>',NULL,NULL,'https://drive.google.com/file/d/10FYPldxZK_4Uv05q9HgwcPMmbXwmsQs5/view?usp=share_link','2023-01-24 08:37:01',NULL,'2023-01-24 08:37:01','2023-01-24 13:29:01'),(1063,927,3,6,NULL,NULL,'prototype',NULL,'id','SehatQu','<p>SehatQu adalah gambaran aplikasi untuk memudahkan pengguna dalam mengontrol kesehatannya dan mengakses fasilitas kesehatan secara online. SehatQu juga menawarkan konsep Sehat dalam genggaman apapun kebutuhan kesehatan pengguna dapat diakses melalui satu aplikasi.</p>','https://drive.google.com/drive/folders/14s7ZgwR4N5mGq1LJ8t0hpxJhwyRkSLcE?usp=share_link','https://drive.google.com/file/d/1DJT58AxaYu-mxzpny993N79Rz_GQbL9k/view?usp=share_link','https://drive.google.com/file/d/1DJT58AxaYu-mxzpny993N79Rz_GQbL9k/view?usp=share_link',NULL,NULL,'2023-01-24 10:08:45','2023-01-24 10:08:45'),(1064,927,1,6,NULL,'1','prototype',NULL,'id','My Culture Dresscode','<p>Platform ini dibuat untuk mengatasi sulitnya mencari tempat penyewaan baju profesi ataupun baju adat, dan menghindari ketidakpuasan penyewaan dikarenakan kondisi baju yang kurang bagus ataupun ukuran yang tidak sesuai.</p>','https://bit.ly/MyCulture-Portofolio','https://bit.ly/MyCulture-Portofolio','https://bit.ly/MyCulture-Portofolio','2023-01-25 07:49:17',NULL,'2023-01-24 10:12:39','2023-01-25 07:49:17'),(1065,927,1,6,NULL,'1','prototype',NULL,'en','My Culture Dresscode','<p><span class=\"selectable-text copyable-text\">This platform was created to overcome the difficulty of finding places to rent professional or traditional clothes and avoid rental dissatisfaction due to the condition of clothes that are not good or sizes that do not fit.</span></p>','https://bit.ly/MyCulture-Porto-EN','https://bit.ly/MyCulture-Porto-EN','https://bit.ly/MyCulture-Porto-EN','2023-01-24 13:22:29',NULL,'2023-01-24 10:50:26','2023-01-24 13:28:55'),(1067,997,3,6,NULL,'1','prototype',NULL,'en','DESIGN AND BUILD FINANCIAL INFORMATION SYSTEM AT UD REJO JAYA TO ACCELERATE THE REPORTING PROCESS','<p><em><span style=\"font-weight: 400;\">UD Rejo Jaya is a business entity engaged in the sale of building equipment. UD Rejo Jaya has 15 employees who are divided into finance, cashier, delivery, warehouse and security sectors. UD rejo jaya has a gross income of seventy to one hundred million in a month, from the amount of income it is necessary to make financial statements.&nbsp;</span></em></p>',NULL,NULL,'https://drive.google.com/file/d/1TTZmdempOykim10DiCxQJsGbIzAPQ4Pz/view?usp=share_link','2023-01-24 15:10:03',NULL,'2023-01-24 15:10:03','2023-01-24 15:10:03'),(1068,996,3,6,NULL,'1','prototype',NULL,'en','HOTEL & KOST FRONT OFFICE INFORMATION SYSTEM AT D\'HOTEL S9 MALANG TO ACCELERATE CUSTOMER SERVICE','<p><span style=\"font-weight: 400;\">This information system is used to provide hotel room reservation services, Check In, Checkout, sales, boarding bookings, Boarding Payments, and Annual Visitor Reports. Users of this system are front office staff, managers and boarding customers. The system was built using PHP scripts with the CodeIgnater framework and My Sql as the DBMS.</span></p>',NULL,NULL,'https://drive.google.com/file/d/1LjZAGx_PKQEbX267PqnHfhdd0Y2xBuK7/view?usp=share_link','2023-01-24 15:13:46',NULL,'2023-01-24 15:13:46','2023-01-26 19:41:08'),(1069,995,7,6,NULL,'1','prototype',NULL,'en','Project Management Internship @Hashmicro','<p><span class=\"S1PPyQ\">The MSIB program is currently a popular internship program among students. One of MSIB\'s partners, Hashmicro Indonesia, has a Project Management team that students can choose from in the batch 3 internship program. The main task of the Project Management team is to handle the ERP implementation of Hashmicro\'s clients throughout Indonesia. This poster will inform you about the responsibilities of the project management team and other activities carried out during the MSIB batch 3 internship period at Hashmicro Indonesia.</span></p>',NULL,NULL,NULL,'2023-01-25 07:48:00',NULL,'2023-01-24 21:50:21','2023-01-25 07:48:00'),(1070,690,1,6,NULL,NULL,'prototype',NULL,'en','Test Project','<p>ini adalah deskripsi project</p>\r\n<div id=\"katalon\">\r\n<div id=\"katalon-spy_elementInfoDiv\" style=\"display: none;\"></div>\r\n</div>','code.com','demo.com','video.com',NULL,NULL,'2023-01-31 14:25:49','2023-01-31 14:41:37'),(1071,690,1,6,NULL,NULL,'prototype',NULL,'en','Edit project','<p>ini adalah deskripsi edit project</p>\r\n<div id=\"katalon\" style=\"top: 0px;\">\r\n<div id=\"katalon-spy_elementInfoDiv\" style=\"display: none;\"></div>\r\n</div>','code.com','demo.com','video.com',NULL,NULL,'2023-01-31 14:41:15','2023-04-12 05:42:50'),(1072,690,1,6,NULL,NULL,'prototype',NULL,'en','Delete','<p>test</p>','code.com','demo.com','video.com',NULL,NULL,'2023-04-12 05:33:26','2023-04-12 05:33:26'),(1073,835,5,6,NULL,NULL,'prototype',NULL,'en','Albino Blood','<p>A 2D platformer game that tells of an elementary school student buying snacks after school, but after consuming it he has a stomach ache. White blood cells called albino blood must fight the incoming bacteria so that it can heal.</p>\r\n<p>Game by Healthy Studio :</p>\r\n<p>1. Julian Arya Pradana Putra - Universitas Budi Luhur<br />2. Jozka Roihutan Siregar - Universitas Pembangunan Nasional Veteran Jakarta<br />3. Iqbal Mubarok - Universitas Catur Insan Cendekia&nbsp;<br />4. Aulia Wahida Hilmi - Sekolah Tinggi Informatika Komputer Indonesia Malang<br />5. Istian Muhammad Wahyu Setiawan - Universitas Pembangunan Nasional Veteran Yogyakarta</p>','https://nvermind.itch.io/albino-blood','https://drive.google.com/file/d/1A-Aiws-n_Z5XOTra0MkCQYkM2375fPVR/view?usp=drive_link','https://drive.google.com/file/d/1NfUe7p6n83QPQKRV9FAuXgzGEzVxXL-j/view?usp=drive_link',NULL,NULL,'2023-06-23 15:23:08','2023-06-23 15:23:08'),(1074,1049,1,6,NULL,NULL,'prototype',NULL,'en','UI/UX | Ship Ticketing Website','<p>The UI/UX design of our ship ticketing website focuses on simplicity and ease of use, ensuring a seamless booking experience for our users. The interface features a clean and intuitive layout with a user-friendly navigation system. Overall, our ship ticketing website\'s UI/UX design prioritizes simplicity, efficiency, and a delightful user journey from start to finish.</p>','https://www.figma.com/community/file/1255433288183271452','https://www.figma.com/community/file/1255433288183271452',NULL,NULL,NULL,'2023-06-27 15:05:09','2023-06-27 15:05:09'),(1075,328,3,6,NULL,NULL,'prototype',NULL,'en','Sistem Informasi Layanan Pelanggan Pada Bengkel Pasti Jaya Services Guna Mempercepat Pelaporan','<p>Sistem informasi ini berguna untuk mengelola proses registrasi pelanggan, permintaan layanan pelanggan,rekap pendaftran pelaggan,informasi kedangan atau anrian, validasi, penentuan mekanik, pembuatan spk, pembuatan tagihan,laporan pelayanan, laporan servis dan laporan barang masuk.melalu sistem ini pelanggan juga akan melihat antrian pelanggan dan melihat perkembangan permintaan layanan. Pengguna sistme ini adalah owner, administrasi dan pelanggan. Sistem dibangun menggunakan PHP dengan kerangka Codeignaiter dan linux sebagai DBMS.</p>',NULL,NULL,NULL,NULL,NULL,'2023-07-04 15:09:16','2023-07-04 15:20:01'),(1076,1055,2,6,NULL,NULL,'copyright','11011211008','en','asasasasas','<p><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">asasasasas</span></span></p>',NULL,NULL,NULL,NULL,NULL,'2023-07-22 17:36:53','2023-07-22 17:36:53'),(1077,1055,2,6,NULL,NULL,'copyright','76235828','en','adadadadad','<p>adadadadad</p>',NULL,NULL,NULL,NULL,NULL,'2023-07-22 17:43:03','2023-07-22 17:43:03');
