INSERT INTO `settings` VALUES (1,'about','<p>STIKI TECHNOFEST merupakan pameran produk Tugas Akhir, Tugas Akhir Mata Kuliah, Magang, Lomba, Proyek Individu dan Proyek Karya Kelompok Bidang Minat dari Program studi Teknik Informatika, Sistem Informatika dan Manajemen Informatika</p>',NULL,NULL,'2022-02-19 11:24:22'),(2,'title','STIKI TECHNOFEST 5.0',NULL,NULL,'2022-12-21 00:18:41'),(3,'logo','setting/Uft65Cbi9BgFwx9aOEl90R9bPzyCvw85b3jditfn.png',NULL,NULL,'2022-02-26 06:51:04'),(4,'event_start','24/01/2023',NULL,NULL,'2022-12-21 00:18:41'),(5,'event_end','26/01/2023',NULL,NULL,'2022-12-21 00:18:41'),(6,'allow_upload','1',NULL,NULL,NULL),(7,'custom_css','#about>div.anim-icons.full-width { &nbsp; &nbsp; background-color: white; } tfoot { &nbsp; &nbsp; display: none; } .page-title { &nbsp; &nbsp; padding: 120px 0 70px; } .blog-categories2 {margin-bottom:20px;padding: 10px;} .categories h4 {border-radius: 0 20px 0 0;background-color: #ededed;text-transform: uppercase;padding: 10px 10px 10px 10px !important;border-bottom: 0 !important;font-size: 13px !important;margin-bottom: 0px !important;}.blog-categories2 li a {font-size:16px;} .blog-categories2 li a:hover {text-decoration:underline;}',NULL,NULL,'2023-01-09 10:10:52'),(8,'style_btn_style_one','#ec167f',1,NULL,'2022-12-21 00:18:41'),(9,'style_info_box','#f20487',1,NULL,'2022-12-21 00:18:41'),(10,'style_image_box','#682372',1,NULL,'2022-12-21 00:18:41'),(11,'style_scroll_to_top','#e1137b',1,NULL,'2022-12-21 00:18:41'),(12,'style_selection','#ec167f',1,NULL,'2022-12-21 00:18:41'),(13,'style_btn_box','#1d95d2',1,NULL,'2022-12-21 00:18:41'),(14,'style_pagination','#ec167f',1,NULL,'2022-12-21 00:18:41'),(15,'style_footer','#101130',1,NULL,'2022-12-21 00:18:41'),(16,'style_page_title','#232323',1,NULL,'2022-12-21 00:18:41'),(17,'style_btn_style_two','#faac1d',1,NULL,'2022-12-21 00:18:41'),(18,'style_scroll_to_top_hover','#4c35a9',1,NULL,'2022-12-21 00:18:41'),(19,'style_btn_style_two_hover',NULL,NULL,NULL,NULL),(20,'style_na